		this.aba3.btn_aba3.addEventListener("click", aba3.bind(this));
		function aba3(){this.aba1.aba1_txt.visible = false; this.aba2.aba2_txt.visible = false; this.aba3.aba3_txt.visible = true; this.aba4.aba4_txt.visible = false;}
		
		
		
